	val testPreProdDeMarket = scenario("de market load test - navigation - chrome").exec(DeMarket.de)

	setUp(
		testPreProdDeMarket.inject(
			atOnceUsers(1),
			rampUsers(10).during(5.seconds),
			constantUsersPerSec(5).during(10.minutes),
			rampUsersPerSec(5).to(10).during(30.minutes).randomized,
			heavisideUsers(50).during(20.minutes)
		).protocols(httpProtocol)
	).assertions(
		global.responseTime.max.between(100, 14000),
		global.successfulRequests.percent.gt(90)
	)
